</style>

■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<br><br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">1円玉から500円玉まで6種類の硬貨を収納でき、 片手で容易に扱える携帯コインホルダー「コインホーム」と、コインホームをより効率的に使える専用ケースのセットです。ケースの内側にはポケットが付いているので、コインホームに収納できない小銭やお札などを入れることができます!!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">110×60×厚さ20mm(コインホーム単体:45×92×12mm)</font><br><font color="#333333" size="-1">個装サイズ：7×13×3cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">42g(コインホーム単体:17g)</font><br><font color="#333333" size="-1">個装重量：90g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">【コインホーム】<br>ABS樹脂、シリコン<br>【ケース】<br>表生地:人工スエード<br>中生地:ナイロン<br>コインホーム接続部:ベルクロ(ループ、フック)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">【コインホーム】<br>・総収容金額:2775円<br>・総収容量116g<br>・収容量<br>500円×4枚<br>100円×5枚<br>50円×4枚<br>10円×5枚<br>5円×4枚<br>1円×5枚</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">コインホーム<br>ケース<br>取扱説明書</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab2--><!--ab--><style type="text/css">
